import React from 'react'

function ArtCard({ artpiece }) {

    // console.log(artpiece)

    const { artist, image, title, price, description} = artpiece


    return (
        <>
            <li>{artist}</li>
            <li>{image}</li>
            <li>{title}</li>
            <li>{price}</li>
        </>
    )
}

export default ArtCard
